  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Burford Lake
  Wildlife Management Area outlines Refuge accomplishments from May through August
  of 1951. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, raptors, and fish- is also
  covered. The Refuge development and maintenance section discusses physical developments
  and wildfires. Resource management is outlined; topics include grazing and fur harvesting.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and Refuge participation. N-R forms and photographs are attached.\",\n\t\"license_title\":
